@media only screen and (max-width: 413px) {
  body {
    padding-top: 5vh;
    height: 100%;
    width: 100%;
  }
  .grid-container {
    width: 100%;
    height: 300vh;
    display: grid;
    grid-template-areas:
      "theme-switch ."
      "heading-and-search heading-and-search"
      "food-item-heading food-item-heading"
      "calories measurement"
      "macro-breakdown macro-breakdown"
      "calories-per-macro calories-per-macro"
      "micro-by-gram micro-by-gram"
      "daily-value daily-value"
      "credit .";
    grid-template-columns: 1fr 1fr;
    grid-template-rows: 0.5fr 0.5fr 0.5fr 1fr 1fr 1fr 1.2fr 1fr 1fr;
    grid-gap: 2vh;
  }

  .theme-switch {
    height: 13vh;
    width: 21vw;
  }

  .theme-mode {
    font-size: 0.7rem;
  }

  .switch {
    width: 10.5vw;
    height: 3.5vh;
  }

  .slider::before {
    height: 3vh;
    width: 4vw;
    bottom: 2px;
    left: 2px;
  }

  input:checked + .slider::before {
    transform: translateX(6vw);
  }

  .heading-and-search-bar {
    height: 5vh;
    width: 90vw;
    margin: 0 auto;
    padding-bottom: 0;
  }

  .top-heading {
    font-size: 0.8rem;
    margin-bottom: 5vh;
  }

  .food-item-heading {
    font-size: 1.3rem;
    padding-top: 5vh;
    margin-bottom: 5vh;
  }

  #search-form {
    width: 60vw;
    height: 5vh;
    margin-top: 2vh;
    margin-bottom: 5vh;
  }

  .search-bar {
    width: inherit;
  }

  #submit-btn {
    right: 1vw;
    width: 9.5vw;
  }

  .calories-box {
    height: 24vh;
    width: 40vw;
  }

  .calories-amount {
    font-size: 2rem;
  }

  .calories-text {
    font-size: 1.5rem;
  }

  .measurement-box {
    height: 24vh;
    width: 40vw;
  }

  .measurement-amount {
    font-size: 2rem;
  }

  .measurement-text {
    font-size: 1.5rem;
  }

  .macro-nutrient-percentage {
    width: 88vw;
    height: auto;
    margin: 0 auto;
  }

  .calories-per-macro-heading {
    margin-top: 2vh;
    font-size: 1rem;
    margin-bottom: 3vh;
  }

  .macro-groups {
    font-size: 0.6rem;
    justify-content: space-around;
  }

  .micro-nutrients-by-gram {
    width: 88vw;
    height: auto;
    margin: 0 auto;
  }

  .micro-nutrients-by-gram {
    width: 88vw;
    height: 38vh;
    margin: 0 auto;
  }

  .percentage-of-daily-value-box {
    width: 70vw;
    margin: 0 auto;
  }

  .nutrient-and-percent-values {
    padding-left: 5vw;
    padding-right: 5vw;
  }

  a img {
    width: 40vw;
    height: 10vh;
  }
}

